function b64toArrayBuffer(b64) {
  const bin = atob(b64);
  const buf = new Uint8Array(bin.length);
  for (let i = 0; i < bin.length; i++) buf[i] = bin.charCodeAt(i);
  return buf.buffer;
}

  camera.position.set(0, 60, 100);

  const renderer = new THREE.WebGLRenderer({ antialias:true });
  renderer.setSize(w, h);
  renderer.setPixelRatio(window.devicePixelRatio);
  renderer.toneMapping = THREE.ACESFilmicToneMapping;
  container.appendChild(renderer.domElement);

  // Lights
  const amb = new THREE.AmbientLight(0xffffff, 0.5);
  scene.add(amb);
  const d1 = new THREE.DirectionalLight(0xffffff, 1.2);
  d1.position.set(50, 80, 60);
  scene.add(d1);
  const d2 = new THREE.DirectionalLight(0xe94560, 0.3);
  d2.position.set(-40, 30, -50);
  scene.add(d2);

  // Material - white PLA
  const mat = new THREE.MeshStandardMaterial({
    color: 0xf0f0f0,
    roughness: 0.55,
    metalness: 0.05,
  });

  const loader = new THREE.STLLoader();
  const geo = loader.parse(b64toArrayBuffer(stlB64));
  geo.computeVertexNormals();
  geo.center();
  const mesh = new THREE.Mesh(geo, mat);
  // Rotate so top faces camera
  mesh.rotation.x = -Math.PI / 2;
  scene.add(mesh);

  const controls = new THREE.OrbitControls(camera, renderer.domElement);
  controls.enableDamping = true;
  controls.autoRotate = true;
  controls.autoRotateSpeed = 2;

  function animate() {
    requestAnimationFrame(animate);
    controls.update();
    renderer.render(scene, camera);
  }
  animate();

  window.addEventListener('resize', () => {
    const nw = container.clientWidth, nh = container.clientHeight;
    camera.aspect = nw/nh;
    camera.updateProjectionMatrix();
    renderer.setSize(nw, nh);
  });
}

createViewer('left', TRI_B64);
createViewer('right', SQ_B64);
</script>
</body>
</html>
